// Import the necessary modules
import React, { useEffect, useLayoutEffect } from 'react';
import { View, Text, StyleSheet } from 'react-native';

import { Button, Card, ListItem, useTheme } from '@rneui/themed';
import ProductPriceInfo from './ProductPriceInfo';
import SellerButton from '../seller/SellerButton';


interface OtherInfoProps {
    otherInfoes: any[];
    increidiblePrice: number
}
const ProductOtherInfo: React.FC<OtherInfoProps> = ({ otherInfoes, increidiblePrice }) => {
    const { theme } = useTheme();
    return (

        <View style={styles.container}>

            {

                otherInfoes && (
                    <Card>

                        <Card.Title style={{ color: theme.colors.text }}> others sellers üêæ</Card.Title>
                        <Card.Divider />
                        {otherInfoes.map((item, index) => (
                            <Card key={index}>

                                <SellerButton sellerInfo={item} />

                                <ListItem.Subtitle>
                                    <ProductPriceInfo productPriceInfo={item} increidiblePrice={increidiblePrice} />
                                </ListItem.Subtitle>
                            </Card>
                        ))}
                    </Card>
                )}

        </View>
    );
};
// Define the styles for the component using StyleSheet
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
    },
    loading: {
        fontSize: 20,
        fontWeight: "bold",
    },
    error: {
        fontSize: 20,
        fontWeight: "bold",
    },
    dataContainer: {
        margin: 10,
    },
    dataTitle: {
        fontSize: 18,
        fontWeight: "bold",
        marginVertical: 5,
    },
    dataSubtitle: {
        fontSize: 16,
        marginVertical: 5,
    },
});

// Export the component
export default ProductOtherInfo;
